import React from "react";
import Navbar from "./Navbar";
import Logo from "./Logo";
import Footer from "./Footer";
import Search from "./Search";

const Short = () => {
  return (
    <div
      style={{
        width: "100vw",
        height: "100vh",
        display: "flex",
        flexDirection: "column",
        justifyContent: "space-between",
        padding: 0,
      }}
    >
      <Navbar />
      <div
        style={{
          marginTop: "-750px",
          display: "flex",
          gap: "50px",
          flexDirection: "column",
        }}
      >
        <Logo />
        <Search />
      </div>
      <div>
        <div className="">
          <p></p>
        </div>
        <div className=""></div>
      </div>
      <Footer />
    </div>
  );
};
export default Short;
